982104091405312	2022-07-21 17:02:31.862	2022-07-21 17:02:31.862	f	excerpt	"巨流河，在清代被称为巨流河；哑口海位于台湾南端，是鹅銮鼻灯塔下的一泓湾流。\\n这本书写的是一个并未远去的时代，关于两代人从巨流河到哑口海的故事。那立志将中国建设成现代化国家的父亲，在牧草中哭泣的母亲，公而忘私的先生；唱着《松花江上》的东北流亡学子，初识文学滋味的南开少女，含泪朗诵雪莱和济慈的朱光潜……\\n六十年来，作者读书、教书，写评论文章，却一直念念不忘当年事。给我们讲述了一个埋藏着巨大悲伤的时代，同时也是一个真正存在过的最有骨气的时代。"	32533118288136105	\N
